// Text Mixins
.underline() {
	text-decoration: none;
	position: relative;
	margin-bottom: 5.5rem;
	&:after {
		position: absolute;
		content: '';
		height: .25ch;
		bottom: -3rem;
		margin: 0;
		left: 0;
		right: 0;
		width: 8rem;
		background: @primaryColor;
	}
}
.overline() {
	font-size: @body;
	margin-bottom: 1rem;
	line-height: @lineHeightBody;
	font-weight: 700;
	text-transform: uppercase;
	letter-spacing: 0;
}

.accent() {
