// Text-based Teaser
div.cmp-teaser.simple {
	background: @textColor;
	img {
		display: none;
	}

	// simple teaser base-styles
	.cmp-teaser__content {
		padding: @verticalSpacing 3.6rem;
		color: @textColorLight;
		display: flex;
		flex-direction: column;
		align-items: flex-start;

		.cmp-teaser__description {
			p {
				margin-bottom: 0;
			}
		}
	}

	// underlined (will not work on centered components)
	&.underline:not(.centered):not(.green) {
		& > .cmp-teaser__content > h2 {
			.underline();
		}
	}

	// centered
	&.centered > .cmp-teaser__content {
		align-items: center;
	}
	&.green > .cmp-teaser__content {
		background: @primaryColor;
	}

	// wide
	&.wide {
		margin-left: calc(50% - 50vw);
		margin-right: calc(50% - 50vw);

		.cmp-teaser__content {
			padding-left: 0;
			padding-right: 0;

			.innerContainerMixin();
		}
	}

	// tall
	&.tall {
		padding: @verticalSpacing 3.6rem;
	}

	// No Background
	&.noBackground {
		background: none;
		.cmp-teaser__content {
			padding: @verticalSpacing 0;
			color: @textColor;
			display: flex;
			flex-direction: column;
			align-items: flex-start;
		}
	}
}

// Background-image Teaser
div.cmp-teaser.image.callOut {
	position: relative;
	min-height: 500px;
	height: fit-content;

	.cmp-image {
		position: absolute;
		width: 100%;
		height: 100%;
		overflow: hidden;

		img {
			height: 100%;
			width: 100%;
			object-fit: cover;
			filter: brightness(.65);
		}
	}
	.cmp-teaser__content {
		padding: 0 1.8rem;
		position: absolute;
		height: 100%;
		color: @textColorLight;
		display: flex;
		flex-direction: column;
		align-items: flex-start;
		justify-content: center;

		h2,
		h2 > a {
			.h3();
			color: white;

			&:hover {
				text-decoration: none;
				cursor: pointer;
			}
		}

		.cmp-teaser__action-container {
			padding-bottom: 0rem !important;
			text-transform: uppercase;
			background-color: @primaryColor;
			border: 2px solid #249c15;
			height: 4rem;
			position: relative;
			display: flex;
			flex-direction: row;
			padding-left: 2rem;

			a {
				position: relative;
				.overline();
				color: white;
				margin-top: 0rem;
				height: 100%;

				&:hover {
					text-decoration: none;

					&:after {
						display: inline-block;
						margin-left: 4rem;
					}
				}

				&:after {
					.fa-icon;
					.fas;
					content: @fa-var-chevron-right;
					font-size: 24px;
					display: inline-block;
					line-height: 1.8;
					margin-left: 2rem;
					padding-top: 0rem;
					margin-top: 0rem;
					padding-left: 1.8rem;
					padding-right: 1.6rem;
					// width: 4rem;
					height: 100%;
					// margin-bottom: -1.6rem;
					// margin-right: .1rem;
					background-color: #249c15;
					transition: all 400ms cubic-bezier(.68, -.55, .265, 1.55);
				}
			}
		}
	}

	// wide
	&.wide {
		margin-left: calc(50% - 50vw);
		margin-right: calc(50% - 50vw);

		.cmp-teaser__content {
			padding-left: 0;
			padding-right: 0;

			.innerContainerMixin();
		}
	}

	&.hero {
		text-align: left;
		min-height: 100vh;

		div:last-of-type {
			padding-bottom: @verticalSpacing;
		}
		.cmp-teaser__content {
			.innerContainerMixin();

			align-items: flex-start;
			justify-content: flex-end;

			h2 {
				.h1();
				.underline();
				margin-bottom: 5.5rem;

				a {
					.h1();
				}
				a:hover {
					text-decoration: none;
					cursor: pointer;
				}
			}
		}
		.cmp-teaser__action-container {
			margin-bottom: @verticalSpacing;
		}
	}

	&.center {
		.cmp-teaser__content {
			align-items: center;
			justify-content: center;
			text-align: center;
			width: 100%;
			max-width: calc(100% - (100% - @containerWidthLarge));
			@media (max-width: 1600px) {
				max-width: calc(100% - (100% - @containerWidthMedium));
			}
			@media (max-width: 767px) {
				max-width: 0 calc(100% - (100% - @containerWidthSmall));
				padding: .5rem 1rem;
				font-size: @caption;

				div.cmp-teaser__action-container {
					margin-bottom: 0rem;
				}
			}
		}
	}

	&.bottom:not(.center) {
		text-align: left;

		.cmp-teaser__content {
			.innerContainerMixin();

			align-items: flex-start;
			justify-content: flex-end;

			h2 {
				.h1();
				margin-bottom: 5.5rem;

				a {
					.h1();
					.underline();
					&:hover {
						text-decoration: none;
						cursor: pointer;
					}
				}
			}

			div:last-of-type {
				padding-bottom: @verticalSpacing;
			}
		}
		div.cmp-teaser__action-container {
			margin-bottom: @verticalSpacing;
		}
	}
}

