		float: right; /* added */
		margin-top: 3.6rem;
		width: calc(100% - 3.6rem); /* added */
		padding-bottom: 60%;
		// overflow: hidden;
		margin-bottom: 1rem;

		@media (max-width: 1600px) {
			padding-bottom: 60%;
		}
		@media (max-width: 767px) {
			padding-bottom: calc(100% - 1.8rem);
		}

		// main image
		img.cmp-image__image {
			position: absolute;
			width: 100%; /* added */
			height: 100%;
			object-fit: cover;
			object-position: 50% 50%;
		}
	}

	// div that holds title & description
	.cmp-teaser__content {
		position: relative;

		// title
		h2.cmp-teaser__title {
			.overline();
			position: absolute;
			margin-top: calc(2rem + 3.6rem);
			margin-left: 3.6rem;
			padding: 1rem 2rem;
			background-color: @primaryColor;
			color: @textColorLight;
			max-width: calc(100% - (100% - @containerWidthLarge));
			@media (max-width: 1600px) {
				max-width: calc(100% - (100% - @containerWidthMedium));
			}
			@media (max-width: 767px) {
				max-width: 0 calc(100% - (100% - @containerWidthSmall));
				padding: .5rem 1rem;
				font-size: @caption;
			}
		}

		// teaser description container
		div.cmp-teaser__description {
			background: transparent;
			margin-left: 3.6rem;
			// teaser description
			p {
				background: transparent;
				font-style: oblique;
				font-size: @caption;
			}
		}
	}
}

// Background-image Teaser
div.cmp-teaser.image.card {
	position: relative;
	display: flex;
	flex-direction: column-reverse;
	justify-content: center;
	align-items: center;
	overflow: hidden;
	width: 100%;
	height: 100%;
	min-height: 350px;
	max-width: 600px;

	margin: auto;
	border: 2px solid @primaryColor;

	.cmp-teaser__image {
		position: relative;
		background: transparent;
		height: 100%;
		width: 100%;

		img {
			position: absolute;
			height: 100%;
			width: 100%;
			object-fit: cover;
			object-position: 50% 50%;
		}
	}
	.cmp-teaser__content {
		position: relative;
		height: 100%;
		text-align: center;
		display: flex;
		flex-direction: column;
		justify-content: center;
		align-items: center;

		h2 {
			.h3();
			color: @primaryColor;
			margin-bottom: 0;
		}

		.cmp-teaser__description {
			p {
				background: transparent;
				margin-bottom: 0;
			}
		}
	}
}
